function [ks,km,fm]=assema(p,t,c,a,f,u,time,sdl)
%ASSEMA Assembles area integral contributions in a PDE problem.
%
%       [K,M,F1]=ASSEMA(P,T,C,A,F) assembles the stiffness matrix K,
%       the mass matrix M, and the right-hand side vector F1.
%
%       The following call sequences are also allowed:
%       [K,M,F1]=ASSEMA(P,T,C,A,F,U0)
%       [K,M,F1]=ASSEMA(P,T,C,A,F,U0,TIME)
%       [K,M,F1]=ASSEMA(P,T,C,A,F,U0,TIME,SDL)
%       [K,M,F1]=ASSEMA(P,T,C,A,F,TIME)
%       [K,M,F1]=ASSEMA(P,T,C,A,F,TIME,SDL)
%
%       The input parameters P, T, C, A, F, U0, TIME, and SDL have the
%       same meaning as in ASSEMPDE.
%
%       See also ASSEMPDE

%       A. Nordmark 4-25-94, AN 8-01-94, AN 01-31-95.
%       Copyright 1994-2003 The MathWorks, Inc.
%       $Revision: 1.9.4.1 $  $Date: 2003/10/21 12:25:58 $
%       Modified by D. Campeão, LNCC/MCT, in 2010/11/23
%       Modified by S.M. Giusti, UTN/FRC - CONICET, in 2011/02/23
%           - added some improvements in the DKT finite element
%             implementation.
%       Modified by S.M. Giusti, UTN/FRC - CONICET, in 2018/08/06
%           - added RM plate finite element implementation.

if or(size(f,1)==1,size(f,1)==2) % scalar or vectorial 2nd order pde
    
    gotu=0;
    gottime=0;
    gotsdl=0;

    if nargin==5
      % No action
    elseif nargin==6
      if size(u,1)>1
        gotu=1;
      else
        time=u;
        gottime=1;
      end
    elseif nargin==7
      if size(u,1)>1
        gotu=1;
        gottime=1;
      else
        sdl=time;
        time=u;
        gottime=1;
        gotsdl=1;
      end
    elseif nargin==8,
      gotu=1;
      gottime=1;
      gotsdl=1;
    else
      error('PDE:assema:nargin', 'Wrong number of input arguments.');
    end

    % Choose triangles to assemble
    if gotsdl
      it=pdesdt(t,sdl);
      t=t(:,it);
    end

    if ~gottime
      time=[];
    end

    nt=size(t,2); % Number of triangles
    np=size(p,2); % Number of points

    % Corner point indices
    it1=t(1,:);
    it2=t(2,:);
    it3=t(3,:);

    % Triangle geometries:
    [ar,g1x,g1y,g2x,g2y,g3x,g3y]=pdetrg(p,t);

    % Find midpoints of triangles
    x=(p(1,it1)+p(1,it2)+p(1,it3))/3;
    y=(p(2,it1)+p(2,it2)+p(2,it3))/3;

    sd=t(4,:);

    if ~gotu,
      uu=[];
      u=[];
      ux=[];
      uy=[];
    else
      uu=u;
      N=length(uu)/np;
      uu=reshape(uu,np,N);
      u=(uu(it1,:).'+uu(it2,:).'+uu(it3,:).')/3;
      ux=uu(it1,:).'.*(ones(N,1)*g1x)+uu(it2,:).'.*(ones(N,1)*g2x)+ ...
         uu(it3,:).'.*(ones(N,1)*g3x);
      uy=uu(it1,:).'.*(ones(N,1)*g1y)+uu(it2,:).'.*(ones(N,1)*g2y)+ ...
         uu(it3,:).'.*(ones(N,1)*g3y);
      uu=reshape(uu,np*N,1);
    end

    if ~gotu,
      % The number of variables IS the number of rows in F
      N=size(f,1);
    end

    % Stiffness matrix
    c=pdetfxpd(p,t,uu,time,c);

    if any(c(:)),
      ks=sparse(N*np,N*np);

      nrc=size(c,1);

      if nrc>=1 && nrc<=4, % Block scalar c
        ks1=pdeasmc(it1,it2,it3,np,ar,x,y,sd,u,ux,uy,time,g1x,g1y,g2x,g2y,g3x,g3y,c);
        [ii,jj,kss]=find(ks1);
        for k=1:N,
          ks=ks+sparse(ii+(k-1)*np,jj+(k-1)*np,kss,N*np,N*np);
        end
      elseif nrc==N || nrc==2*N || nrc==3*N || nrc==4*N, % Block diagonal c
        nb=nrc/N;
        m1=1;
        m2=nb;
        for k=1:N,
          ks1=pdeasmc(it1,it2,it3,np,ar,x,y,sd,u,ux,uy,time,g1x,g1y,g2x,g2y,g3x,g3y,c(m1:m2,:));
          [ii,jj,kss]=find(ks1);
          ks=ks+sparse(ii+(k-1)*np,jj+(k-1)*np,kss,N*np,N*np);
          m1=m1+nb;
          m2=m2+nb;
        end
      elseif nrc==2*N*(2*N+1)/2, % Symmetric c
        m1=1;
        m2=4;
        for l=1:N,
          for k=1:l-1,
            ks1=pdeasmc(it1,it2,it3,np,ar,x,y,sd,u,ux,uy,time,g1x,g1y,g2x,g2y,g3x,g3y,c(m1:m2,:));
            [ii,jj,kss]=find(ks1);
            ks=ks+sparse(ii+(k-1)*np,jj+(l-1)*np,kss,N*np,N*np);
            m1=m1+4;
            m2=m2+4;
          end
          m1=m1+3;
          m2=m2+3;
        end
        ks=ks+ks.';
        m1=1;
        m2=3;
        for k=1:N,
          ks1=pdeasmc(it1,it2,it3,np,ar,x,y,sd,u,ux,uy,time,g1x,g1y,g2x,g2y,g3x,g3y,c(m1:m2,:));
          [ii,jj,kss]=find(ks1);
          ks=ks+sparse(ii+(k-1)*np,jj+(k-1)*np,kss,N*np,N*np);
          m1=m1+3+4*k;
          m2=m2+3+4*k;
        end
      elseif nrc==4*N*N, % General (unsymmetric) c
        m1=1;
        m2=4;
        for l=1:N,
          for k=1:N,
            ks1=pdeasmc(it1,it2,it3,np,ar,x,y,sd,u,ux,uy,time,g1x,g1y,g2x,g2y,g3x,g3y,c(m1:m2,:));
            [ii,jj,kss]=find(ks1);
            ks=ks+sparse(ii+(k-1)*np,jj+(l-1)*np,kss,N*np,N*np);
            m1=m1+4;
            m2=m2+4;
          end
        end
      else
        error('PDE:assema:NumRowsC', 'Wrong number of rows of c.');
      end % nrc
      clear c ks1;
    else
      clear c;
      ks=sparse(N*np,N*np);
    end
    
elseif size(f,1)==3 % begin PLATE stiffness matrix assembling
    u=[];
    time=[];
    gotu=0;
    gottime=0;
    gotsdl=0;

    if nargin==5
      % No action
    elseif nargin==6
        gotsdl=1;
    else
      error('PDE:assema:nargin', 'Wrong number of input arguments.');
    end

    % Choose triangles to assemble
    if gotsdl
      it=pdesdt(t,sdl);
      t=t(:,it);
    end

    nt=size(t,2); % Number of triangles
    np=size(p,2); % Number of points

    % Corner point indices
    it1=t(1,:);
    it2=t(2,:);
    it3=t(3,:);

    % Triangle geometries:
    [ar,g1x,g1y,g2x,g2y,g3x,g3y]=pdetrg(p,t);
    
    if size(c,1)==2 % begin DKT stiffness matrix assembling
        % Find midpoints of triangles
        x=(p(1,it1)+p(1,it2)+p(1,it3))/3;
        y=(p(2,it1)+p(2,it2)+p(2,it3))/3;

        sd=t(4,:);

        if ~gotu,
          uu=[];
          u=[];
          ux=[];
          uy=[];
        else
          uu=u;
          N=length(uu)/np;
          uu=reshape(uu,np,N);
          u=(uu(it1,:).'+uu(it2,:).'+uu(it3,:).')/3;
          ux=uu(it1,:).'.*(ones(N,1)*g1x)+uu(it2,:).'.*(ones(N,1)*g2x)+ ...
             uu(it3,:).'.*(ones(N,1)*g3x);
          uy=uu(it1,:).'.*(ones(N,1)*g1y)+uu(it2,:).'.*(ones(N,1)*g2y)+ ...
             uu(it3,:).'.*(ones(N,1)*g3y);
          uu=reshape(uu,np*N,1);
        end

        if ~gotu,
          % The number of variables IS the number of rows in F
          N=size(f,1);
        end

        % Stiffness matrix

        %Data processing
        %Build ID array
        ID=zeros(3,np);
        ID(1,1:np)=1:np;        %DOF 1: W, transversal displacement
        ID(2,1:np)=ID(1,:)+np;  %DOF 2: theta x, rotation around x axis 
        ID(3,1:np)=ID(1,:)+2*np;%DOF 3: theta y, rotation around y axis


        IDv1=ID(:,it1);
        IDv2=ID(:,it2);
        IDv3=ID(:,it3);

        %Build LM array
        LM=zeros(9,nt);
        LM(1:3,1:nt)=IDv1(1:3,1:nt);
        LM(4:6,1:nt)=IDv2(1:3,1:nt);
        LM(7:9,1:nt)=IDv3(1:3,1:nt);

        %Triangle coorners coordinates
        %Global coordinates
        x1g=p(1,it1)';
        x2g=p(1,it2)';
        x3g=p(1,it3)';
        y1g=p(2,it1)';
        y2g=p(2,it2)';
        y3g=p(2,it3)';

        %Calcula beta

        beta=zeros(nt,1);
        beta(:) = asin(1.0);
        delx = x2g-x1g;
        dely = y2g-y1g;

        auxdelx = (delx ~= 0.0);
        auxdely = (dely < 0.0);
        beta(auxdelx) = atan(dely(auxdelx)./delx(auxdelx));
        beta(~auxdelx & auxdely) = -beta(~auxdelx & auxdely);
        Cos = cos(beta);
        Sen = sin(beta);

        %Local coordinates
        x1 = Cos.*(x1g - x1g) + Sen.*(y1g - y1g);
        y1 =-Sen.*(x1g - x1g) + Cos.*(y1g - y1g);

        x2 = Cos.*(x2g - x1g) + Sen.*(y2g - y1g);
        y2 =-Sen.*(x2g - x1g) + Cos.*(y2g - y1g);

        x3 = Cos.*(x3g - x1g) + Sen.*(y3g - y1g);
        y3 =-Sen.*(x3g - x1g) + Cos.*(y3g - y1g);

        x1=x1';
        y1=y1';
        x2=x2';
        y2=y2';
        x3=x3';
        y3=y3';
        Cos = Cos';
        Sen = Sen';

        %Alpha Matrix
        x12 = x1-x2;
        y12 = y1-y2;
        x23 = x2-x3;
        y23 = y2-y3;
        x31 = x3-x1;
        y31 = y3-y1;

        l122 = x12.*x12 + y12.*y12;
        l232 = x23.*x23 + y23.*y23;
        l312 = x31.*x31 + y31.*y31;

        p4 = -6*x23./l232;
        p5 = -6*x3 ./l312;
        p6 = -6*x12./l122;

        t4 = -6*y23./l232;
        t5 = -6*y3 ./l312;

        q4 = 3*x23.*y23./l232;
        q5 = 3*x3.*y3  ./l312;

        r4 = 3*(y23.*y23)./l232;
        r5 = 3*(y31.*y31)./l312;

        % Assembly the contributions of elements to the global system
        ks=sparse(N*np,N*np);

        %Element matrix

        %Material Properties
        %h=1;
        %nu = c(6,:)./c(1,:);
        %E = 2*c(4,:).*(1.+nu);
        %E1 = E*h*h*h./(12.*(1.-nu.*nu));
        %E1 = E./(1.-nu.*nu);
        
        nu = c(2,:)./c(1,:);
        E1 = c(1,:);
        E2 = c(2,:);
        E3 = E1;
        E4 = E1.*(1.-nu)./2;
        
        
        %Elements of stiffness matrix
        alfa11 = y3.*p6;
        %alfa12 = 0.0;
        alfa13 = -4.0.*y3;
        alfa14 = -alfa11;
        %alfa(1,5) = 0.0;
        alfa16 = -2.0.*y3;
        %alfa17 = 0.0;
        %alfa18 = 0.0;
        %alfa19 = 0.0;
        alfa21 = alfa14;
        %alfa22 = 0.0;
        alfa23 = -alfa16;
        alfa24 = alfa11;
        %alfa25 = 0.0;
        alfa26 = -alfa13;
        %alfa27 = 0.0;
        %alfa28 = 0.0;
        %alfa29 = 0.0;
        alfa31 = y3.*p5;
        alfa32 = -y3.*q5;
        alfa33 = y3.*(2.0 - r5);
        alfa34 = y3.*p4;
        alfa35 = y3.*q4;
        alfa36 = y3.*(r4 - 2.0);
        alfa37 = -y3.*(p4 + p5);
        alfa38 = y3.*(q4 - q5);
        alfa39 = y3.*(r4 - r5);
        alfa41 = -x2.*t5;
        alfa42 = x23 + x2.*r5;
        alfa43 = -x2.*q5;
        %alfa44 = 0.0;
        alfa45 = x3;
        %alfa46 = 0.0;
        alfa47 = -alfa41;
        alfa48 = x2.*(r5 - 1.0);
        alfa49 = alfa43;
        %alfa51 = 0.0;
        alfa52 = x23;
        %alfa53 = 0.0;
        alfa54 = x2.*t4;
        alfa55 = x3 + x2.*r4;
        alfa56 = -x2.*q4;
        alfa57 = -alfa54;
        alfa58 = x2.*(r4 - 1.0);
        alfa59 = alfa56;
        alfa61 = x23.*t5;
        alfa62 = x23.*(1.0 - r5);
        alfa63 = x23.*q5;
        alfa64 = -x3.*t4;
        alfa65 = x3.*(1.0 - r4);
        alfa66 = x3.*q4;
        alfa67 = -alfa61 -alfa64;
        alfa68 = -x23.*r5 - x3.*r4 - x2;
        alfa69 = alfa66 + alfa63;
        alfa71 = -x3.*p6 - x2.*p5;
        alfa72 = -alfa43 + y3;
        alfa73 = -4.0.*x23 + x2.*r5;
        alfa74 = x3.*p6;
        alfa75 = -y3;
        alfa76 = 2.0.*x3;
        alfa77 = x2.*p5;
        alfa78 = -alfa43;
        alfa79 = (r5 - 2.0).*x2;
        alfa81 = -x23.*p6;
        alfa82 = y3;
        alfa83 = 2.0.*x23;
        alfa84 = -alfa81 + x2.*p4;
        alfa85 = -y3 - alfa56;
        alfa86 = -4.0.*x3 + x2.*r4;
        alfa87 = -x2.*p4;
        alfa88 = -alfa56;
        alfa89 = (r4 - 2.0).*x2;
        alfa91 = x23.*p5 + y3.*t5;
        alfa92 = -alfa63 + (1.0 - r5).*y3;
        alfa93 = (2.0 - r5).*x23 - alfa32;
        alfa94 = -x3.*p4 + y3.*t4;
        alfa95 = (r4 - 1.0).*y3 - alfa66;
        alfa96 = (2.0 - r4).*x3 - alfa35;
        alfa97 = -x23.*p5 + x3.*p4 - (t4 + t5).*y3;
        alfa98 = -alfa63 - alfa66 + (r4 - r5).*y3;
        alfa99 = -x23.*r5 - x3.*r4 + 4.0*x2 + (q5 - q4).*y3;

        k11 = (1/24./ar).*((alfa11.*alfa11 + alfa21.*alfa21 + alfa31.*alfa31 + alfa21.*alfa31 + alfa11.*(alfa21 + alfa31)).*E1...
                           +(alfa21.*(alfa41 + alfa61) + alfa11.*(2.0.*alfa41 + alfa61) + alfa31.*(alfa41 + 2.0.*alfa61)).*E2...
                           +(alfa41.*alfa41 + alfa41.*alfa61 + alfa61.*alfa61).*E3...
                           +(alfa71.*alfa71 + alfa81.*alfa81 + alfa81.*alfa91 + alfa91.*alfa91 + alfa71.*(alfa81 + alfa91)).*E4);

        k12 = (1/48./ar).*((alfa11.*(alfa32.*Cos - (2.0*alfa13 + alfa23 + alfa33).*Sen) + alfa21.*(alfa32.*Cos - (alfa13 + 2.0.*alfa23 + alfa33).*Sen)...
                                + alfa31.*(2.0.*alfa32.*Cos - (alfa13 + alfa23 + 2.0.*alfa33).*Sen)).*E1...
                           +((alfa21.*alfa42 + alfa31.*alfa42 + 2.0.*alfa21.*alfa52 + alfa31.*alfa52 + alfa32.*(alfa41 + 2.0.*alfa61) + alfa21.*alfa62 + 2.0.*alfa31.*alfa62).*Cos...
                                - (2.0.*alfa13.*alfa41 + alfa23.*alfa41 + alfa33.*alfa41 + alfa21.*alfa43 + alfa31.*alfa43 + alfa13.*alfa61 + alfa23.*alfa61 + 2.0.*alfa33.*alfa61).*Sen...
                                - (alfa21.*alfa63 + 2.0.*alfa31.*alfa63).*Sen + alfa11.*((2.0.*alfa42 + alfa52 + alfa62).*Cos - (2.0.*alfa43 + alfa63).*Sen)).*E2...
                           +((alfa61.*(alfa42 + alfa52 + 2.0.*alfa62) + alfa41.*(2.0.*alfa42 + alfa52 + alfa62)).*Cos - (alfa61.*(alfa43 + 2.0.*alfa63) + alfa41.*(2.0.*alfa43 + alfa63)).*Sen).*E3...
                           +((2.0.*alfa81.*alfa82 + alfa82.*alfa91 + alfa72.*(alfa81 + alfa91) + alfa81.*alfa92 + 2.0.*alfa91.*alfa92 + 2.0.*alfa71.*alfa72 + alfa71.*alfa82 + alfa71.*alfa92).*Cos...
                                - (alfa73.*alfa81 + 2.0.*alfa81.*alfa83 + alfa73.*alfa91 + alfa83.*alfa91 + alfa81.*alfa93 + 2.0.*alfa91.*alfa93 + 2.0.*alfa71.*alfa73 + alfa71.*alfa83 + alfa71.*alfa93).*Sen).*E4);

        k13 = (1/48./ar).*(((2.0.*alfa21.*alfa23 + alfa23.*alfa31 + alfa13.*(alfa21 + alfa31) + alfa21.*alfa33 + 2.0.*alfa31.*alfa33 + alfa11.*(2.0.*alfa13 + alfa23 + alfa33)).*Cos + ((alfa11 + alfa21 + 2.0.*alfa31).*alfa32).*Sen).*E1...
                           +(((2.0.*alfa13 + alfa23 + alfa33).*alfa41 + (2.0.*alfa11 + alfa21 + alfa31).*alfa43 + (alfa13 + alfa23 + 2.0.*alfa33).*alfa61 + (alfa11 + alfa21 + 2.0.*alfa31).*alfa63).*Cos...
                                + (alfa32.*(alfa41 + 2.0.*alfa61) + alfa11.*(2.0.*alfa42 + alfa52 + alfa62) + alfa21.*(alfa42 + 2.0.*alfa52 + alfa62) + alfa31.*(alfa42 + alfa52 + 2.0.*alfa62)).*Sen).*E2...
                           +((alfa41.*(2.0.*alfa43 + alfa63) + alfa61.*(alfa43 + 2.0.*alfa63)).*Cos + (alfa41.*(2.0.*alfa42 + alfa52 + alfa62) + alfa61.*(alfa42 + alfa52 + 2.0.*alfa62)).*Sen).*E3...
                           +((2.0.*alfa81.*alfa83 + alfa83.*alfa91 + alfa73.*(alfa81 + alfa91) + alfa81.*alfa93 + 2.0.*alfa91.*alfa93 + alfa71.*(2.0.*alfa73 + alfa83 + alfa93)).*Cos + ((2.0.*alfa81 + alfa91).*alfa82 + alfa72.*(alfa81 + alfa91) + (alfa81 + 2.0.*alfa91).*alfa92 + alfa71.*(2.0.*alfa72 + alfa82 + alfa92)).*Sen).*E4);

        k14 = (1/48./ar).*((2.0.*alfa21.*alfa24 + alfa24.*alfa31 + alfa14.*(alfa21 + alfa31) + alfa21.*alfa34 + 2.0.*alfa31.*alfa34 + alfa11.*(2.0.*alfa14 + alfa24 + alfa34)).*E1...
                           +((2.0.*alfa14 + alfa24 + alfa34).*alfa41 + (alfa11 + 2.0.*alfa21 + alfa31).*alfa54 + (alfa14 + alfa24 + 2.0.*alfa34).*alfa61 + (alfa11 + alfa21 + 2.0.*alfa31).*alfa64).*E2...
                           +(alfa41.*(alfa54 + alfa64) + alfa61.*(alfa54 + 2.0.*alfa64)).*E3...
                           +(2.0.*alfa81.*alfa84 + alfa84.*alfa91 + alfa74.*(alfa81 + alfa91) + alfa81.*alfa94 + 2.0.*alfa91.*alfa94 + alfa71.*(2.0.*alfa74 + alfa84 + alfa94)).*E4);

        k15 = (1/48./ar).*((((alfa11 + alfa21 + 2.0.*alfa31).*alfa35).*Cos - (2.0.*alfa21.*alfa26 + alfa26.*alfa31 + alfa16.*(alfa21 + alfa31) + alfa21.*alfa36 + 2.0.*alfa31.*alfa36 + alfa11.*(2.0.*alfa16 + alfa26 + alfa36)).*Sen).*E1...
                           +((alfa35.*(alfa41 + 2.0.*alfa61) + alfa11.*(2.0.*alfa45 + alfa55 + alfa65) + alfa21.*(alfa45 + 2.0.*alfa55 + alfa65) + alfa31.*(alfa45 + alfa55 + 2.0.*alfa65)).*Cos...
                                - ((2.0.*alfa16 + alfa26 + alfa36).*alfa41 + (alfa11 + 2.0.*alfa21 + alfa31).*alfa56 + (alfa16 + alfa26 + 2.0.*alfa36).*alfa61 + (alfa11 + alfa21 + 2.0.*alfa31).*alfa66).*Sen).*E2...
                           +((alfa41.*(2.0.*alfa45 + alfa55 + alfa65) + alfa61.*(alfa45 + alfa55 + 2.0.*alfa65)).*Cos - (alfa41.*(alfa56 + alfa66) + alfa61.*(alfa56 + 2.0.*alfa66)).*Sen).*E3...
                           +((2.0.*alfa81.*alfa85 + alfa85.*alfa91 + alfa75.*(alfa81 + alfa91) + alfa81.*alfa95 + 2.0.*alfa91.*alfa95 + alfa71.*(2.0.*alfa75 + alfa85 + alfa95)).*Cos...
